import axios from 'axios';
const { match: { params } } = this.props;
const SpringPatientsListApiUrl=`https://tumorboard-308606.el.r.appspot.com/getPatientDetailsKeyValue/${params.patient_id_fk}`;

class PatientsList{

    getApi(){
        return axios.get(SpringPatientsListApiUrl);
    }
}
export default new PatientsList();
